import React from 'react';

const WebSite = () => {
    return (
        <div className='justfiy-center rounded shadow-md bg-red-700 border-solid border-2 border-gray-600 w-2/5 py-2 hover:cursor-pointer'>
            <a className='text-slate-50 font-semibold text-lg' href='https://www.google.com/'>Visit Website</a>
        </div>
    );
}

export default WebSite;
